import React from 'react';
import CareerList from '../CareerList/CareerList';
import "./Career.css";

export default function Career() {

    const {selected, setSelected} = useState("eduucation");
    const list = [
        {
            id: "Education",
            name: "Education"
        },
        {
            id: "Projects",
            name: "Projects"
        },
        {
            id: "Experience",
            name: "Experience"
        }
    ]

    return (
        <div className="career" id="career">
            <h1>Career</h1>
            <ul>
                {list.map(item=>(
                    <CareerList title={item.name} active={selected === item.id} setSelected={setSelected}></CareerList>
                ))}
            </ul>
            <div className="career-items">
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
                <div className="item">
                    <div className="placeholder"></div>
                    <h3>San Francisco State University</h3>
                </div>
            </div>
        </div>
    )
}
